function Filter() {
  const position = {
    container: "*:pb-4",
  };
  return (
    <div className={position.container}>
      <Price />
      <Discount />
      <Color />
      <Size />
    </div>
  );
}

export default Filter;

// Sub-components

function Price() {
  const design = {};

  return (
    <>
      <h4 className={design.heading}>Price</h4>
      {["0-1000", "1000-2000", "2000-3000"].map((item) => (
        <div key={item}>
          <input type="radio" name={item} />
          <span>{item}</span>
        </div>
      ))}
    </>
  );
}

function Discount() {
  const design = {
    heading: "text-lg font-medium",
  };

  return (
    <>
      <h4 className={design.heading}>Discount</h4>
    </>
  );
}

function Color() {
  const design = {
    heading: "text-lg font-medium",
  };

  return (
    <>
      <h4 className={design.heading}>Color</h4>
    </>
  );
}

function Size() {
  const design = {
    heading: "text-lg font-medium",
  };

  return (
    <>
      <h4 className={design.heading}>Size</h4>
    </>
  );
}
